import React from "react";
import Amazon from "./Amazon";
import Cards from "./Cards";
import Netflix from "./Netflix";
import Sdata from "./SData";

const fav="netflix";

const App=()=>(
    <>
    <h1>Most viewewd seasons in 2022</h1>
     {Sdata.map((val)=>{         
    return(  
        <Cards
        key = {val.id}
        imgsrc={val.imgsrc}
        title={val.title}
        SName={val.SName}
        refrence={val.refrence}
        />);

     })}
     {fav==="amazon"? <Netflix/>:<Amazon/>}

        {console.log(Sdata)}
    </>
    );
    export default App;
